import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Route,Routes } from 'react-router-dom'
  import Home from './containers/Home'

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact ='/' ele={<Home />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
